@props(['dark' => false])

@pushOnce('styles')
	<style>
		svg#freepik_stories-outer-space:not(.animated) .animable {
			opacity: 0;
		}

		svg#freepik_stories-outer-space.animated #freepik--Character--inject-2 {
			animation: 1s 1 forwards ease-in slideUp, 1.5s Infinite linear floating;
			animation-delay: 0s, 1s;
		}

		@keyframes slideUp {
			0% {
				opacity: 0;
				transform: translateY(30px);
			}

			100% {
				opacity: 1;
				transform: inherit;
			}
		}

		@keyframes floating {
			0% {
				opacity: 1;
				transform: translateY(0px);
			}

			50% {
				transform: translateY(-10px);
			}

			100% {
				opacity: 1;
				transform: translateY(0px);
			}
		}
	</style>
@endPushOnce

